pragma solidity ^0.8.0;

// SPDX-License-Identifier: BUSL-1.1

import "./Interfaces/InterfacesV2.sol";

contract OptionMeta {
    struct Input {
        uint256 optionId;
        address contractAddress;
    }
    struct OptionMetaData {
        uint256 optionId;
        IBufferOptions.State state;
        uint256 strike;
        uint256 amount;
        uint256 lockedAmount;
        uint256 premium;
        uint256 expiration;
        IBufferOptions.OptionType optionType;
        bool isYes;
        bool isAbove;
        uint256 iv;
        uint256 assetPrice;
        uint256 priceAtExpiration;
        address owner;
        address contractAddress;
    }

    function get_price_at_timestamp(address priceProvider, uint256 timestamp)
        public
        view
        returns (uint256)
    {
        AggregatorV3Interface priceProviderContract = AggregatorV3Interface(
            priceProvider
        );
        (
            uint80 roundId,
            uint256 answer,
            ,
            uint256 latestTimestamp,

        ) = priceProviderContract.latestRoundData();

        if (latestTimestamp > timestamp) {
            bool isCorrectRoundId;
            while (!isCorrectRoundId) {
                roundId = roundId - 1;
                (
                    ,
                    uint256 roundAnswer,
                    ,
                    uint256 roundTimestamp,

                ) = priceProviderContract.getRoundData(roundId);
                if ((roundTimestamp > 0) && (roundTimestamp <= timestamp)) {
                    isCorrectRoundId = true;
                    answer = roundAnswer;
                }
            }
        }
        return answer;
    }

    function get_option_data(
        Input[] calldata options,
        address[] calldata optionsContracts
    ) public view returns (OptionMetaData[] memory allOptions) {
        allOptions = new OptionMetaData[](options.length);

        for (uint256 i = 0; i < options.length; i++) {
            IBufferOptions binaryOptionsContract = IBufferOptions(
                optionsContracts[i]
            );
            IBufferOptions.Option memory option = binaryOptionsContract.options(
                options[i].optionId
            );
            (bool isYes, bool isAbove) = binaryOptionsContract.binaryOptionType(
                options[i].optionId
            );
            address priceProvider = binaryOptionsContract.priceProvider();

            uint256 priceAtExpiry = (option.state ==
                IBufferOptions.State.Active &&
                block.timestamp > option.expiration)
                ? get_price_at_timestamp(priceProvider, option.expiration)
                : 0;
            allOptions[i] = OptionMetaData(
                options[i].optionId,
                option.state,
                option.strike,
                option.amount,
                option.lockedAmount,
                option.premium,
                option.expiration,
                option.optionType,
                isYes,
                isAbove,
                IOptionsConfig(binaryOptionsContract.config()).impliedVolRate(),
                binaryOptionsContract.getUsdPrice(),
                priceAtExpiry,
                binaryOptionsContract.ownerOf(options[i].optionId),
                options[i].contractAddress
            );
        }
        return allOptions;
    }
}
